import React, { useEffect, useState } from 'react';
import axios from 'axios'; 
import { API_BASE_URL } from './AuthUser';

export default function Home() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        axios.get('http://localhost/react-js-authentication-laravel/Laravel/public/api/users') 
            .then(response => {
                const barberUsers = response.data.users.filter(user => user.rol === 'barbero');
                setUsers(barberUsers);
            })
            .catch(error => {
                console.error('Error al obtener la lista de usuarios:', error);
            });
    }, []);

    return (
        <div>
            <h1>Lista de Barberos</h1>
            <ul>
                {users.map(user => (
                    <li key={user.id}>{user.name} - {user.email}</li>
                    // Personaliza cómo deseas mostrar los datos de cada usuario.
                ))}
            </ul>
        </div>
    );
}
